import React from "react";
import styled from "styled-components";

const Para_Heading = ({heading, para, para2, para3}) => {
  const {headingData} = heading;
  const {paraData} = para;
  const {paraData2} = para2;
  const {paraData3} = para3;
  return (
    <>
      <Wrapper>
        <div className="container">
          <div className="content">
            <h1>{headingData}</h1>
            <p>{paraData}</p>
            <p>{paraData2}</p>
            <p>{paraData3}</p>
          </div>
        </div>
      </Wrapper>
    </>
  );
};
const Wrapper = styled.section`
padding:9rem 0;
{
  h1,
  p{
    color:${({theme}) => theme.colors.heading};
    text-align:justify;
    margin:2rem 0 0 0;
  }
}
`;
export default Para_Heading;
